import java.util.Scanner;

public class Q1073 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner scanner=new Scanner(System.in);
		int input;
		while(true) {
			input=scanner.nextInt();
			if(input==0) {
				break;
			}
			System.out.println(input);
		}
	}

}
